import './App.css';
import TextField from '@mui/material/TextField'
import Button from '@mui/material/Button'
import Box from '@mui/material/Box';


function App() {
  return (
    <div className="App">
      <header className='Header'>Ohm's Law Calculator</header>
      <div className='Parent'>
        <Box m={10} p={10}>

            <TextField id="filled-basic" label="Volts" variant="filled" />
            <TextField id="filled-basic" label="Ampere" variant="filled" />
            <TextField id="filled-basic" label="Ohms" variant="filled" />
            <TextField id="filled-basic" label="Watts" variant="filled" />

        </Box>


        <div className='Buttons'>
          <Button variant="contained">Calculate</Button>
        </div>
      </div>

    </div>
  );
}

export default App;
